script: |
  super -f text -I q3798.spq | sort > q3798.out

inputs:
  - name: q3798.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * - col1 / col2 * - ( + - col2 ) <= NULL OR NOT + 45 = - 1 * 93;
  - name: tab1

outputs:
  - name: q3798.out
    data: |
      51	14	96
      85	5	59
      91	47	68
